INSERT INTO `wiki` VALUES ('069929875837-4cae-7582-e61ac3463803','Home','2016-11-24 10:52:54','2016-11-24 10:52:54','1','Hammad Hassan','1','Hammad Hassan',0,'published',0,1,'886','<p>Lets see how this works</p>',NULL),('1','Home','2016-01-01 00:00:00','2016-01-01 00:00:00','1','Hammad Hassan','1','Hammad Hassan',0,'published',0,5,'1','<h1 class=\"ql-align-center\">Projects4Me</h1><p><br></p><h2>Intro.</h2><p>Welcome to Projects4Me. The open source project management and collaboration tool that will help you deliver successful project repeatedly.</p><p><br></p><p>The main features of this tool are as follows</p><p><br></p><ol><li>Issue tracking</li><li>Real time chat</li><li>Conversions</li><li>Time logging</li><li>Advance reporting</li><li>Workflow management</li></ol><p><br></p><h2>Target Audience</h2><p>Software Industry</p><p><br></p><h2>Pricing</h2><p>Open source and free, if you want <em>hosting</em> then you just pay for the hosting. online edition comes with support as well as new feature roll outs in real time.</p><p><br></p><h2>License</h2><p>AGPL</p><p><br></p><p>This will surely be an awesome project!!!!</p>',''),('16b0d1805837-9deb-9acb-54b251a09e78','Home','2016-11-24 10:31:50','2016-11-24 10:31:50','1','Hammad Hassan','1','Hammad Hassan',0,'published',0,1,'645','<p>A Corp is a <strong>dummy</strong> business that is ran by dummy people.</p><p><br></p><pre spellcheck=\"false\">Note: Important thing is the dummy part\n</pre><p><br></p><h2>History</h2><p>	As a wise man once said, do not concern about the past as it is <span style=\"background-color: rgb(250, 204, 204);\">history</span>.</p><p><br></p>',NULL),('1d9c28715846-4cc4-bca2-0e3073690c2d','Hello','2016-12-06 04:03:41','2016-12-06 04:03:41','1','Hammad Hassan','1','Hammad Hassan',0,'published',0,1,'1','<h1>Hello!!</h1><p><br></p><p><span style=\"background-color: rgb(204, 232, 204);\">is it me that you are looking for?</span></p>','61436b425837-a569-1d53-8acc206e1971'),('21844680583c-b7cd-29ed-f0fac6d6ca7e','Templates','2016-11-28 02:42:41','2016-11-28 02:42:41','1','Hammad Hassan','1','Hammad Hassan',0,'published',0,1,'1','<p>These are templates in the system</p>',NULL),('26e79a20585c-f3eb-5273-6e593f035a80','Test 4','2016-12-22 11:57:26','2016-12-22 11:57:26','1','Hammad Hassan','1','Hammad Hassan',0,'published',0,1,'1','<p>Data Model</p>','a607e2215835-b8f6-bf45-62703a8a48f8'),('3368f0a85837-8a9d-1d53-9248760c275a','Awesome','2016-11-24 10:19:31','2016-11-24 10:19:31','1','Hammad Hassan','1','Hammad Hassan',0,'published',0,1,'1','<p>At least take me to the right page.</p><p><br></p><p>This did work!!</p>','61436b425837-a569-1d53-8acc206e1971'),('377b3241588d-5fb4-5278-f4a6c72ae03b','Equipment','2017-01-28 20:57:27','2017-01-28 20:57:27','1','Hammad Hassan','1','Hammad Hassan',0,'published',0,1,'244','<p>We need to provide the detail for the security equipment required by the firm</p><p><br></p><p>Security Camera</p><p>Data Servers</p><p>Access Controls</p><p>Body scanner</p><p>Locks</p><p>Bolts</p><p>Firewalls</p><p>Power generators</p><p>UPS</p><p>Backup batteries</p><p><br></p>',NULL),('3fcb1293585c-f3eb-5273-417e7b8ed151','Test5','2016-12-22 11:57:51','2016-12-22 11:57:51','1','Hammad Hassan','1','Hammad Hassan',0,'published',0,1,'1','<p>Test5</p>','a607e2215835-b8f6-bf45-62703a8a48f8'),('42cd9f835835-fdcf-bcd6-8f6d37577e61','Welcome to our World of thousand pain','2016-11-23 09:22:10','2016-11-23 09:22:10','1','Hammad Hassan','1','Hammad Hassan',0,'published',0,1,'1','<h1><span style=\"color: rgb(51, 51, 51);\">Welcome to our World</span></h1><p><br></p><p>Hello World!!!!</p><p><br></p><p>How do you do?</p><p><br></p><p>Composed By: <strong><em>Hammad Hassan</em></strong></p><p><em>Date Created: </em><em style=\"background-color: rgb(255, 255, 204);\">2nd January, 2016</em></p>',''),('4c700aa7585c-328c-5273-b7148fcad756','Test 7','2016-12-22 12:02:20','2016-12-22 12:02:20','1','Hammad Hassan','1','Hammad Hassan',0,'published',0,1,'1','<p>Test 7</p>','