blished',0,1,'1','<p>This is the index route</p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">import Ember from <span class=\"hljs-string\">\"ember\"</span>;\n\n<span class=\"hljs-comment\">/**\n  The module route, it is loaded when a user tried to navigate to the route\n  :projectId e.g. acme.projects4.me/app/wiki/1\n\n  <span class=\"hljs-doctag\">@class</span> app.wiki.project.index\n  <span class=\"hljs-doctag\">@extends</span> Ember.Route\n*/</span>\nexport <span class=\"hljs-keyword\">default</span> Ember.Route.extend({\n\n&nbsp;<span class=\"hljs-comment\">/**\n&nbsp;&nbsp;The current project\n\n&nbsp;&nbsp;<span class=\"hljs-doctag\">@property</span> project\n&nbsp;&nbsp;<span class=\"hljs-doctag\">@private</span>\n&nbsp;*/</span>\n&nbsp;project: {},\n\n&nbsp;<span class=\"hljs-comment\">/**\n&nbsp;&nbsp;The setup controller function that will be called every time the user visits the route, this function is responsible for loading the required data for the route\n\n&nbsp;&nbsp;<span class=\"hljs-doctag\">@method</span> setupController\n&nbsp;&nbsp;<span class=\"hljs-doctag\">@param</span> controller {Object} the controller object for this route\n&nbsp;&nbsp;<span class=\"hljs-doctag\">@private</span>\n&nbsp;*/</span>\n&nbsp;setupController:<span class=\"hljs-function\"><span class=\"hljs-keyword\">function</span><span class=\"hljs-params\">(controller)</span></span>{\n\n&nbsp;&nbsp;<span class=\"hljs-keyword\">var</span> <span class=\"hljs-keyword\">self</span> = this;\n&nbsp;&nbsp;this.project = this.store.findRecord(<span class=\"hljs-string\">\'project\'</span>,params.projectId,{rels:<span class=\"hljs-string\">\'none\'</span>});\n&nbsp;&nbsp;controller.set(<span class=\"hljs-string\">\'project\'</span>,this.project);\n&nbsp;}\n});\n</pre>','927c1692583c-7785-29ed-eb7494f80f86'),('8487e3a3583c-7785-29ed-b5767999f6aa','Test1','2016-11-28 02:40:04','2016-11-28 02:40:04','1','Hammad Hassan','1','Hammad Hassan',0,'published',0,1,'1','<p>Test1</p>',