1, 51, 51);\">Entities</span></h1><p>This is the list of all the entities in the system that we are going to use.</p><p><br></p><h2><span style=\"color: rgb(51, 51, 51);\">Projects</span></h2><p>	Projects obviously are the most basic unit in this project, everything in the system even the ACL and Navigation menu is tied to projects.</p><p><br></p><h2><span style=\"color: rgb(51, 51, 51);\">Banner</span></h2><p>	A banner is a banner, it cannot be anything else and it should not be anything more or else.</p><p><br></p><h2><span style=\"color: rgb(51, 51, 51);\">System</span></h2><p>	A system is composition of units which are designed to represent a system. So if a system = a and unit = b and units = c then as per the Pythagoras theorem if a = b and b = c then a = c. This basically means that a system is after all a system </p><p><br></p><h2><span style=\"color: rgb(51, 51, 51);\">Test</span></h2><p>	A test is what is used in order to verify the working of a system as per the intention it was designed for.</p><p><br></p><h2><span style=\"color: rgb(51, 51, 51);\">Alpha Maniac</span></h2><p>	A you make a really awesome and super cool system but it is one that is absolutely nuts is called alpha maniac.</p>',''),('a86956c9583c-b7cd-29ed-8d8291c6c288','Detail','2016-11-28 02:44:56','2016-11-28 02:44:56','1','Hammad Hassan','1','Hammad Hassan',0,'published',0,1,'1','<p>Detail View</p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\"><span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">div</span> <span class=\"hljs-attr\">class</span>=<span class=\"hljs-string\">\"view detail-view\"</span>&gt;</span>\n&nbsp;{{action-menu definition=metaData.buttons onSave=\"onSave\"}}\n\n&nbsp;<span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">h3</span>&gt;</span>{{module}} : {{model.name}}<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">h3</span>&gt;</span>\n&nbsp;{{#<span class=\"hljs-name\">each-in</span> metaData.sections as |section sections|}}\n&nbsp;<span class=\"h