h3><u>Introduction</u></h3><p><br></p><p>In order to achieve appropriate scrolling the following structure must be implemented</p><p><br></p><pre spellcheck=\"false\">&lt;style&gt;\n	.container{\n		height:100%;\n		width:100%;\n		position:relative;\n		overflow:hidden;\n	}\n	.contents{\n		height:100%;\n		width:100%;\n		position:absolute;\n		overflow:auto;\n	}\n&lt;/style&gt;\n\n&lt;div class=\"container\"&gt;\n	&lt;div class=\"contents\"&gt;\n		This would be scroll-able content.\n	&lt;/div&gt;\n&lt;/div&gt;\n</pre><p><br></p><p><span style=\"background-color: rgb(250, 204, 204);\">Note: It is important to note that the container is not optional, it is a must and without the relative container there is no way for the contents to know the bounds required for scrolling</span></p>',NULL),('d689e622588d-5fb4-0b4c-119ba0419972','Security Cameras','2017-01-28 21:00:06','2017-01-28 21:00:06','1','Hammad Hassan','1','Hammad Hassan',0,'published',0,1,'244','<h2>Security Cameras</h2><p><br></p><p>We need to have 110% coverage! with 6 months backup</p><p><br></p><p>Storage </p><p>Server Rack.</p>','377b3241588d-5fb4-5278-f4a6c72ae03b'),('e6518a605837-bc3f-9acb-95e557f6d093','Test','2016-11-24 10:39:34','2016-11-24 10:39:34','1','Hammad Hassan','1','Hammad Hassan',0,'published',0,1,'645','<p>This is another test page</p>',NULL),('f9c68291588d-c44f-5278-9266d7264ba6','Home','2017-01-28 20:56:25','2017-01-28 20:56:25','1','Hammad Hassan','1','Hammad Hassan',0,'published',0,1,'244','<h2 class=\"ql-align-center\">Primis Inc.</h2><p><br></p><p>The company is looking for the state of the art security infrastructure. The company create ERP software and has been in business for more than 20 years. They have big customer in their portfolio but now they have to work with a government to provide the Punjab assembly with the ERP solution. Although they have good security measures but now they need to be on the next level and must have level 10 clearance before they can even connect to the government infrastructure.</p><p><br></p><p><strong><u>Requirements</u></strong></p><ul><li>Security Camera</li><li>Data Servers</li><li>Audit</li><li>Access Controls</li><li>Intrusion Detection</li><li>Intrusion Prevention</li><li>Body scanner</li><li>Locks</li><li>Bolts</li><li>Locker room</li><li>Firewalls</li><li>Power generators</li><li>UPS</li><li>Backup batteries</li></ul><p><br></p><p><strong><u>Budget :</u></strong> $25,000,000</p><p><br></p><p><strong><u>Timeline :</u></strong> 2 months</p><p><br></p><p><strong><u>Challenges</u></strong></p><ul><li>Detailed documentation required</li><li>Extended support required</li><li>Man power</li><li>Equipment stock</li></ul><p><br></p>',NULL),('ffd27fa8585c-328c-d95e-9ade69d1a276','Test 10','2016-12-22 12:05:19','2016-12-22 12:05:19','1','Hammad Hassan','1','Hammad Hassan',0,'published',0,1,'1','<p>Test 10</p>','a607e2215835-b8f6-bf45-62703a8a48f8');
